import React from "react";

import "./checkoutAmount.styles.css";

const CheckoutAmount = () => {
  return (
    <div className="checkout-amount">
      <div className="checkout-details">
        <div className="checkout-product">2 * msp</div>
        <div className="checkout-promotion">no</div>
        <div className="checkout-total">24</div>
      </div>
      <div className="checkout-btn">btn</div>
    </div>
  );
};

export default CheckoutAmount;
